pragma solidity ^0.4.20;

import './SafeMath.sol';
import './InterMaps.sol';
import './RoomBasic.sol';
import './LibContract.sol';


contract Inter is LibContract{
    using InterMaps for InterMaps.MapAddr2Inter;
    using SafeMath for uint;

    address owner;

    uint constant MARGIN_THRESHOLD_INTER  = 100;    // Inter至少抵押数量

    event Register(address addr, string nodeid, uint amount);
    event ModifyNodeId(address addr, string nodeid, uint amount);
    event ApplyForLock(address addr, uint locktime);
    event ApplyForUnLock(address addr, uint locktime);
    event UnRegister(address addr, string nodeid, uint amount);
    event SelectInter(address tableManage,uint256 tableid, address playerAddr, uint number);
    event ApplyForInter(address roomAddr, uint tableId, uint number);
    event RportFailInter(address roomAddr, uint tableId, address interAddr);
    event RecordFailInter(address roomAddr, uint tableId, address interAddr);
    event ReApplyForInter(address roomAddr, uint tableId, uint number);

    struct ExceptionInfo {
        address     addr;       // 异常的Inter或者公证者，异常情况：1,对table的部分或者全部玩家异常; 2,对部分或者全部table异常
        address[]   players;    // 汇报异常的玩家
        uint8       status;     // 如果已经向Inter合约汇报异常，置为1
    }

    InterMaps.MapAddr2Inter addr2Inters;
    mapping(address=>bool) public games;//游戏合约
    //address public roomMgrAddr;            // RoomManager合约地址
    //address public tableMgrAddr;    // TableManager合约地址
   // mapping(address => mapping(uint256 => address[]))   table2inters;   // table地址 -- 选择的inter地址

    mapping(address => mapping(uint => address[]))  room2tbInAddr;      // room地址 -- (tableId -- Inter地址) 正在使用
    mapping(address => mapping(uint => address[]))  room2tbInAddr_I;    // room地址 -- (tableId -- Inter地址) 已异常
    mapping(address => mapping(uint => uint))       room2tbNrNum;       // room地址 -- table选择的Inter数量

    mapping (address => mapping(uint => ExceptionInfo[]))  room2tbExcNr;   // room地址 -- (table号码 -- 异常Inter者)
                                                        // (使用 mapping (uint => mapping(address => address[])会不会存在数据不清理？)
    mapping(address => uint) nrAddr2failCout;   // 公证者地址 -- Inter异常次数
    mapping(address => uint) nrAddr2SuccCout;   // 公证者地址 -- Inter成功次数

    constructor() public {
        owner = msg.sender;
        _setContract("InterManager",this); //注册合约到模块
    }

    function setTableMgr(address tableMgr) public {
        assert(msg.sender == owner);
        games[tableMgr]=true;
        //tableMgrAddr = tableMgr;
    }

    //function getTableMgr() public view returns(address) {
    //    return tableMgrAddr;
    //}

    function setRoomMgrAddr(address roomMgr) public {
        assert(msg.sender == owner);
        games[roomMgr] = true;
        //roomMgrAddr = roomMgr;
    }

    // function getRoomMgrAddr() public view returns(address) {
    //     return roomMgrAddr;
    // }

    /**
     * @dev 生成随机整数
     * @param seed 种子
     * @return 随机数
     */
    function rand(uint seed) internal view returns(uint) {
        return uint(sha256(block.difficulty, now, seed));
    }

    /**
     * @dev 注册inter
     * @param nodeid inter的node id
     */
    function register(string nodeid) public payable returns (bool) {
        uint amount = msg.value;    // 获取抵押金额
        require(amount >= 0);

        address addr = msg.sender;
        if(!addr2Inters.contains(addr)) {
            require(amount >= MARGIN_THRESHOLD_INTER, "Insufficient amount of mortgage");
        }
        else {
            amount += addr2Inters.get(addr).pawnAmount;
        }

        InterMaps.InterInfo memory interinfo = InterMaps.InterInfo(addr, nodeid, amount, 0, 0, 0);
        addr2Inters.insert(addr, interinfo);

        emit Register(addr, nodeid, amount);
        return true;
    }

    /**
     * @dev 修改inter的nodeid
     * @param nodeid inter的node id
     */
    function modifyNodeid(string nodeid) public {
        address addr = msg.sender;

        if(!addr2Inters.contains(addr)) {
            return;
        }

        InterMaps.InterInfo memory info = addr2Inters.get(addr);
        info.nodeid = nodeid;

        addr2Inters.insert(addr, info);

        emit ModifyNodeId(addr, nodeid, info.pawnAmount);
    }

    /**
     * @dev 获取Inter信息
     */
    function getInterInfo(address interAddr) public view returns(address, string, uint, uint, uint, uint) {
        InterMaps.InterInfo memory inter = addr2Inters.get(interAddr);
        return (inter.addr, inter.nodeid, inter.pawnAmount, inter.totHand, inter.succHand, inter.locktime);
    }

    /**
     * @dev Inter申请锁定账户，Inter不在线负责消息转发时，才可以转出抵押的资金
     * @return 是否成功
     */
    function applyForLock() public returns (bool) {
        address addr = msg.sender;

        if(!addr2Inters.contains(addr)) {
            return false;
        }

        InterMaps.InterInfo memory interInfo = addr2Inters.get(addr);
        interInfo.locktime = now;

        emit ApplyForLock(addr, interInfo.locktime);

        return addr2Inters.insert(addr, interInfo);
    }

    /**
     * @dev Inter申请解锁账户
     * @return 是否成功
     */
    function applyForUnLock() public returns (bool) {
        address addr = msg.sender;

        if(!addr2Inters.contains(addr)) {
            return false;
        }

        InterMaps.InterInfo memory interInfo = addr2Inters.get(addr);
        interInfo.locktime = 0;

        emit ApplyForUnLock(addr, now);

        return addr2Inters.insert(addr, interInfo);
    }

    /**
     * @dev Inter注销
     * @return 是否成功
     */
    function unRegister() public returns (bool) {

        return true;
    }

    /**
     * @dev Inter运行信息上报
     */
    function runInfo(bytes info) public {

    }

    /**
     * @dev Inter运行信息上报
     * @param table table地址
     * @param interAddr inter地址
     * @param totHand 负责转发的总局数
     * @param succHand 成功转发的局数
     */
    function runInfo2(address table, address interAddr, uint totHand, uint succHand) public {
        if(!addr2Inters.contains(interAddr)) {
            return;
        }

        InterMaps.InterInfo memory interInfo = addr2Inters.get(interAddr);
        interInfo.totHand = interInfo.totHand.add(totHand);
        interInfo.succHand = interInfo.succHand.add(succHand);

        addr2Inters.insert(interAddr, interInfo);
    }

    /**
     * @dev 获取已注册inter的数量
     */
    function numberOfInter() public view returns (uint) {
        return addr2Inters.size();
    }

    /**
     * @dev 获取未锁定inter的数量
     */
    function numberOfUnlockInter() public view returns (uint) {
        uint total = addr2Inters.size();

        uint number = 0;
        for(uint i = 0; i < total; i++) {
            if(0 == addr2Inters.getValueByIndex(i).locktime) {
                number++;
            }
        }

        return number;
    }

    // /**
    //  * @dev 分配inter给桌子
    //  * @param tableid tableid
    //  * @param number 分配inter的个数
    //  */
    // function select(uint256 tableid, address playerAddr, uint number) public returns(string ret) {
